/*Table structure for table `tblcompra` */

DROP TABLE IF EXISTS `tblcompra`;

CREATE TABLE `tblcompra` (
  `IdCompra` int(11) NOT NULL AUTO_INCREMENT,
  `IdEmpleado` int(11) DEFAULT NULL,
  `IdProveedor` int(11) DEFAULT NULL,
  `Total` float DEFAULT NULL,
  `TipoPago` set('Efectivo','Tarjeta') DEFAULT NULL,
  `Cambio` float DEFAULT NULL,
  `Fecha` date DEFAULT NULL,
  PRIMARY KEY (`IdCompra`),
  KEY `fkProveedor` (`IdProveedor`),
  KEY `fkEmpleado` (`IdEmpleado`),
  CONSTRAINT `fkEmpleado` FOREIGN KEY (`IdEmpleado`) REFERENCES `tblempleado` (`IdEmpleado`),
  CONSTRAINT `fkProveedor` FOREIGN KEY (`IdProveedor`) REFERENCES `tblproveedor` (`IdProveedor`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

/*Data for the table `tblcompra` */

/*Table structure for table `tbldetallecompra` */

DROP TABLE IF EXISTS `tbldetallecompra`;

CREATE TABLE `tbldetallecompra` (
  `IdDetallecompra` int(11) NOT NULL AUTO_INCREMENT,
  `IdCompra` int(11) DEFAULT NULL,
  `IdFruta` int(11) DEFAULT NULL,
  `Cantidad` float DEFAULT NULL,
  `PrecioUnidad` float DEFAULT NULL,
  `Subtotal` float DEFAULT NULL,
  PRIMARY KEY (`IdDetallecompra`),
  KEY `fkCompra` (`IdCompra`),
  KEY `fkFruta` (`IdFruta`),
  CONSTRAINT `fkCompra` FOREIGN KEY (`IdCompra`) REFERENCES `tblcompra` (`IdCompra`),
  CONSTRAINT `fkFruta` FOREIGN KEY (`IdFruta`) REFERENCES `tblfruta` (`IdFruta`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

