/*Table structure for table `tblprodxfruta` */

DROP TABLE IF EXISTS `tblprodxfruta`;

CREATE TABLE `tblprodxfruta` (
  `IdFruta` int(11) NOT NULL,
  `IdProd` int(11) NOT NULL,
  PRIMARY KEY (`IdFruta`,`IdProd`),
  KEY `fkInvent` (`IdFruta`),
  KEY `fkProd` (`IdProd`),
  CONSTRAINT `fkInvent` FOREIGN KEY (`IdFruta`) REFERENCES `tblfruta` (`IdFruta`),
  CONSTRAINT `fkProd` FOREIGN KEY (`IdProd`) REFERENCES `tblproducto` (`IdProducto`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

/*Data for the table `tblprodxfruta` */

/*Table structure for table `tblproveedor` */

DROP TABLE IF EXISTS `tblproveedor`;

CREATE TABLE `tblproveedor` (
  `IdProveedor` int(11) NOT NULL AUTO_INCREMENT,
  `Nombre` varchar(50) DEFAULT NULL,
  `Colonia` varchar(50) DEFAULT NULL,
  `Correo` varchar(50) DEFAULT NULL,
  `Telefono` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`IdProveedor`),
  KEY `fkDirProveedor` (`Colonia`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

