/*Table structure for table `tblventa` */

DROP TABLE IF EXISTS `tblventa`;

CREATE TABLE `tblventa` (
  `IdVenta` int(11) NOT NULL AUTO_INCREMENT,
  `IdEmpleado` int(11) DEFAULT NULL,
  `TipoPago` set('Efectivo','Tarjeta') DEFAULT NULL,
  `Total` float DEFAULT NULL,
  `Cambio` float DEFAULT NULL,
  `Fecha` datetime DEFAULT NULL,
  PRIMARY KEY (`IdVenta`),
  KEY `fkEmple` (`IdEmpleado`),
  CONSTRAINT `fkEmple` FOREIGN KEY (`IdEmpleado`) REFERENCES `tblempleado` (`IdEmpleado`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

