/* Procedure structure for procedure `SP_ActualizarEmpleado` */

/*!50003 DROP PROCEDURE IF EXISTS  `SP_ActualizarEmpleado` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_ActualizarEmpleado`(in IdEmpleado1 int,IN Nombre1 VARCHAR(50),IN Apaterno1 VARCHAR(50),IN Amaterno1 VARCHAR(50),IN Email1 VARCHAR(50),IN Telefono1 VARCHAR(50), IN Estado1 VARCHAR(50),IN Municipio1 VARCHAR(50),IN Colonia1 VARCHAR(50))
BEGIN
	DECLARE IdEstado1 INT;
	DECLARE IdMunicipio1 INT;
	DECLARE IdDireccion1 INT;
	
	SET IdEstado1=(SELECT IdEstado FROM tblestado WHERE tblestado.`Estado`= Estado1);
	SET IdMunicipio1=(SELECT IdMunicipio FROM tblmunicipio WHERE tblmunicipio.`Municipio`=Municipio1);
	SET IdDireccion1=(SELECT IdDireccion FROM tbldirecciones WHERE tbldirecciones.`Direccion`=Colonia1);
	
	update tblempleado set Nombre=Nombre1, Apaterno=Apaterno1, Amaterno=Amaterno1, Email=Email1, Telefono=Telefono1,IdEstado=IdEstado1,IdMunicipio=IdMunicipio1,IdColonia=IdDireccion1 where IdEmpleado=IdEmpleado1;

	END */$$
DELIMITER ;

