/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`trini`@`%` SQL SECURITY DEFINER VIEW `vistaemc` AS (select `tblestado`.`Estado` AS `Estado`,`tblmunicipio`.`Municipio` AS `Municipio`,`tbldirecciones`.`Direccion` AS `Direccion` from ((`tblestado` join `tblmunicipio`) join `tbldirecciones`) where `tbldirecciones`.`IdMunicipio` = `tblmunicipio`.`IdMunicipio` and `tblmunicipio`.`IdEstado` = `tblestado`.`IdEstado`) */;

